import React from "react";
import MvEmail from "../generalLayout/mvEmail";
import Motor3d from "../generalLayout/motor3d";
import PageName from "../generalLayout/pageName";
import {
  ScrollNavFunction,
} from "../generalFunctionForOnScroll/ScrollEventFor_MotorPage";
import MotorPageHeader from "../generalLayout/motorPageHeader";
import MotorSlideImg from "../generalLayout/motorSlideImg";
import { FooterGe } from "../generalLayout/footer_test";
import Nav from "../generalLayout/nav";
import { NavWhiteCompact } from "../generalFunctionForOnScroll/ScrollEventFor_Homepage";
import NavDesktop from "../generalLayout/navDesk";

const heroGradientStart = "#161716";
const heroGradientEnd = "#525552";
const brutale1000serieoro_infor = {
  namePage: "Brutale 1000 SERIE ORO",
  price: "42.990",
  nameHeaderTitle: "brutale1000serieoro/brutale-1000-serie-oro.svg",
  bgHeaderParallax: "brutale1000serieoro/brutale-1000-serie-oro-popup-xl-1.png",
  manifesto_Arr: ["FASTEST", "NAKED", "IN", "THE WORLD"],
  colorBg: `linear-gradient(90deg,${heroGradientStart} 0%,${heroGradientEnd} 100%)`,
  contentHeaderContent:
    "The pursuit of the ultimate performance, with over 300 km/h top speed. Overcoming the limit of the tracks",
  Model3ds: [
    {
      link: "brutale1000serieoro/original/brutaleSerieOro",
      color:
        "linear-gradient(45deg, rgba(45,0,12,1) 25%, rgba(121,9,9,1) 50%, rgba(255,0,0,1) 100%)",
      nameOfColor: "MATT AGO RED",
    },
  ],
};
export default function BodyBrutale1000SerieOro() {
  window.addEventListener("scroll", () => {
    ScrollNavFunction();
    NavWhiteCompact();
  });

  return (
    <>
      <div
        className="nav-pc-homepage"
        style={{
          height: "84px",
          width: "100vw",
          background: brutale1000serieoro_infor.colorBg,
        }}
      ></div>
      <NavDesktop />
      <Nav color="white" />
      <PageName namePage={brutale1000serieoro_infor.namePage} />
      <MotorPageHeader
        manifesto_Arr={brutale1000serieoro_infor.manifesto_Arr}
        nameHeaderTitle={brutale1000serieoro_infor.nameHeaderTitle}
        titleSize="auto 23%"
        colorBg={brutale1000serieoro_infor.colorBg}
        contentHeaderContent={brutale1000serieoro_infor.contentHeaderContent}
        price={brutale1000serieoro_infor.price}
        bgHeaderParallax={brutale1000serieoro_infor.bgHeaderParallax}
        reveredContent={true}
        heightContentTop="13%"
      />
      <Motor3d
        models={brutale1000serieoro_infor.Model3ds}
      />
      <MvEmail></MvEmail>
      <br />
      <FooterGe />
    </>
  );
}
